.side-menu {
  position: absolute;
  top: 0px;
  left: 0px;
  width: 40px;
  height: auto;
  top: 50vh;
  transform: translate(2px, -50%);
}
.side-menu > .btn {
  width: 20px;
  height: 20px;
  display: flex;
  justify-content: center;
  align-items: center;
  background: #F9F9FB;
  border-radius: 1px;
  padding: 2px;
  box-shadow: 2px 0px 10px rgba(0, 0, 0, 0.2);
  color: #425A70;
  border: solid 1px #E4E7EB;
}
.side-menu > .btn:hover {
  box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.5);
  background: #E4E7EB;
  cursor: pointer;
}

